Create a Controllers folder in the solution, right click on it, and add a Controller file, choose API > Empty API Controller and name it QrController.cs The created file should have this structure: using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Mvc; namespace QrGeneratorAPI.Controllers
{ [Route("api/[controller]")] [ApiController] public class QrController : ControllerBase { }
} Remove the Route attribute as we won't need a global one

26.body:
Let's get our QrGenerator injected into our controller, to do so, start by adding a IQrGenerator variable to your class as private and add a constructor to your class like so: using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Mvc; namespace QrGeneratorAPI.Controllers
{ private IQrGenerator QrGenerator { get; set; } public QrController(IQrGenerator qrGenerator) { if (qrGenerator == null) throw new ArgumentNullException(nameof(qrGenerator)); this.QrGenerator = qrGenerator; }
} Blazor DI will take care of injecting the service as a parameter to your constructor when constructing the instance, you don't have anything particular to do.

