Now, let's get some routes in our controller shall we; we're going to need three routes: A route to generate a Qr Code from text A route to generate a Qr Code from a phone number A route to generate a Qr Code from an email structure If you did not implement all of these functions in your library, you can go back and do it, if you don't want to, just don't implement the routes for them. Adding a route handler is really easy, all you have to do is create a function, add the parameters you want aswell as how to get them (Exemple: From the body, from json, from the query URL...), add the HTTP method to handle, and a return type! I'll make the first one for you, so you can reuse the code for your own routes [HttpGet] // We handle HTTP Get requests ...
[Route("api/qr/text")] // ... on https://domain.com/api/qr/text
public IActionResult GetText([FromQuery(Name = "text")] string text) // We need a parameter named text that will be taken from the query URL ?name=
{ return Ok("Everything went fine"); // We return a 200 with a message
} Now that you have your routes setup, let's make them do useful things, but I'm not going to help you for this one, I'll just guide you a bit. Your code will need to do these things: Call QrGenerator.From Method and get the byte data return a file using File() with image/png as the MIME type.

